	function create(htmlStr) {
		var frag = document.createDocumentFragment(),
        temp = document.createElement('div');
		temp.innerHTML = htmlStr;
		while (temp.firstChild) {
			frag.appendChild(temp.firstChild);
		}
        return frag;
}
       
function start(){
 var but=document.getElementById("submitMeButton");
 but.addEventListener("click",onClickButton,true);
 var textarea=document.getElementById("qid");
 textarea.addEventListener("keydown",function(ev){if(ev.keyCode==13){onClickButton(ev);}},true);
}

function onClickButton(ev){
var textarea2=document.getElementById("qid").value;
var textarea=textarea2.toLowerCase();
textarea=textarea.replace(/(\ )*\n+(\ )*/g," ");
textarea=textarea.replace(/\s+/g, ' ');
 if(textarea.indexOf('create trygger')!=-1){
    ev.stopImmediatePropagation();
    ev.preventDefault();
    ev.stopPropagation();  
    test(textarea2);
 }
}

function test(textarea){
	var query = queryfyText(textarea);
 if (query==-1){
 	return -1;
	}
	var urlyql="";
	if (query.yqlFilter===""){
		urlyql="https://query.yahooapis.com/v1/public/yql?q="+encodeURIComponent(query.uses+"select * from "+query.odtTable1)+"&env=store%3A%2F%2Fdatatables.org%2Falltableswithkeys";
	}else{
		urlyql="https://query.yahooapis.com/v1/public/yql?q="+encodeURIComponent(query.uses+"select * from "+query.odtTable1+" where "+query.yqlFilter)+"&env=store%3A%2F%2Fdatatables.org%2Falltableswithkeys";
	}

GM_xmlhttpRequest({
	  method: "GET",
	  url: urlyql,
	  onload: function(response) {
	    var parser=new DOMParser();
	    var xml=parser.parseFromString(response.responseText, "text/xml");
	    var err=xml.getElementsByTagName("error");
	    var res=null;
	    if(err.length>0){
	     res=err[0].getElementsByTagName("description")[0].firstChild.textContent;
	    }else{
	     res="ok";
	    }
	    document.getElementById("viewContent").innerHTML=res;
	  }
	 });
	 return 0;

}
  

function queryfyText(textarea){
	var query={};
	query.query=textarea;
	var a=textarea.toLowerCase();
	//USE "http://github.com/iker/yql-tables/raw/master/facebook/facebook.setStatus.xml" AS facebook.setStatus;
	/*if(a===""){
	 a='USE "http://github.com/iker/yql-tables/raw/master/facebook/facebook.setStatus.xml" AS facebook.setStatus;CREATE TRYGGER Twitter2Facebook AFTER SELECT CHANGES ON twitter.search WHEN q in ("from:musclenerd", "from:oscaronekin") AND text LIKE "%JB%" BEGIN NAMESPACES ("http://www.w3.org/2005/Atom" AS atom);INSERT INTO facebook.setStatus (uid, status, access_token) VALUES ("689274514", "\' + NEW.results.text.* + \'", "1182584532.AQDVvHnYMUAiq5.3600.13050.0-68514|FHO2bE_GyD5HNUS4U_w"); END'; 
	}*/
	a=a.replace(/(\ )*\n+(\ )*/g," ");
	a=a.replace(/\s+/g, ' ');
	while (a.indexOf('new.')!=-1){
		a=a.replace('new.', 'NEW.');
		}
	while (a.indexOf('"')!=-1){
		a=a.replace('"', "'");
		}
	// If not a trigger return -1
	var odtTableIndex=a.indexOf('create trygger');

	if(odtTableIndex==-1){return -1;}
	
	var useString=a.substring(0,3);
	var puntoyComa=a.indexOf(';');
	   
	query.url="";
	query.odtTable="";
	var uses="";
	if (useString=='use') {
	  uses=a.substring(0, puntoyComa);
	  var useArray=uses.split(' ');
	  query.url=useArray[1];
	  query.odtTable=useArray[3];  
	} 
	query.uses=uses;
	var tryggerNameIndex=a.indexOf('after select changes on');
	var use=a.substring(odtTableIndex, tryggerNameIndex-1);
	useArray=use.split(' ');
	query.tryggerName=useArray[2];
 
 var whenIndex=a.indexOf('when');
	var beginIndex=a.indexOf('begin');
	if (whenIndex==-1){
		whenIndex=beginIndex;
	}
	use=a.substring(tryggerNameIndex, whenIndex-1);
	useArray=use.split(' ');
	query.odtTable1=useArray[4];
	
	whenIndex=a.indexOf('when');
	if (whenIndex!=-1){
		query.yqlFilter=a.substring(whenIndex+4, beginIndex-1);
	}else{
		query.yqlFilter="";
	}
	var endIndex=a.indexOf('end');
	var actionStatement=a.substring(beginIndex+6,endIndex-1);
	
	//Mirar si hay NAMESPACES
	var nsString= actionStatement.substring(0,13);
	
	query.nameSpace="";
	query.urlns="";
	query.alias="";
	
	if (nsString =='xmlnamespaces') {
	  
	  var cierreparentesis= actionStatement.indexOf(")");
	  query.nameSpace= actionStatement.substring(0,cierreparentesis+1);
	
	  var as= query.nameSpace.indexOf("as");
	  //var cierreparentesis= query.nameSpace.indexOf(")");
	
	  var primerasComillas= query.nameSpace.indexOf('"');
	  var ultimasComillas= query.nameSpace.lastIndexOf('"');
	 
	    query.urlns= query.nameSpace.substring(primerasComillas,ultimasComillas+1);
	    query.alias= query.nameSpace.substring(as+3, cierreparentesis);
	
	  actionStatement = actionStatement.substring(cierreparentesis+2, endIndex);
	}
	
	var huecoIndex= actionStatement.indexOf(" ");
	query.yqlStatement="";
	query.jsCode="";
	if ((actionStatement.substring(0,huecoIndex)=='insert') || (actionStatement.substring(0,huecoIndex)=='delete') || (actionStatement.substring(0,huecoIndex)=='select') || (actionStatement.substring(0,huecoIndex)=='update') ){
	  puntoComa= actionStatement.indexOf(";");
	  query.yqlStatement= actionStatement.substring(0, endIndex-1);
	} else {
	  query.jsCode= actionStatement.substring(0,endIndex-1);
	}
 query.username= getUserName();
 /*
alert ('query.query:'+query.query);
alert ('query.url:'+query.url);
alert ('query.odtTable:'+query.odtTable);
alert ('query.uses:'+query.uses);
alert ('query.tryggerName:'+query.tryggerName);
alert ('query.odtTable1: '+query.odtTable1);
alert ('query.yqlFilter: '+query.yqlFilter);
alert ('query.nameSpace: '+query.nameSpace);
alert ('query.urlns: '+query.urlns);
alert ('query.alias: '+query.alias);
alert ('query.yqlStatement: '+query.yqlStatement);
alert ('query.jsCode: '+query.jsCode);
alert ('query.username: '+query.username);
*/
return query;
}

var firstOpen = true;
function isLoggedIn (){
	var user = getUserName ();
	if (user == ""){
		alert ("TRYGGER: You are not logged in YQL console!!! Sign in, please.");
		return false;
	}else{
		if (firstOpen){
		
			firstOpen = false;
			loadTriggers();
		}
		return true;	
	}
}

function getUserName (){
 var userClass = document.getElementsByClassName('salute');
  if (userClass[0]==null)
  {
   return '';
  }else{
   return userClass[0].innerHTML; 
 }
}
